import React from 'react'



const Vacation = (props) => {

const seasonTest = (props) => {
     if(props.season === "Summer"){
         return "url('data:image/jpeg;base64,')"
    }else if(props.season === "Spring"){
        return "url('data:image/jpeg;base64,')"
   }else if(props.season === "Fall"){
    return "url('data:image/jpeg;base64,')"
    }else {
        return "url('data:image/jpeg;base64,')"
    }
}

const priceCheck = (props) => {
    if (props.price < 501){
        return '$'
    }else if (props.price < 1001){
        return '$$'
    }else {
        return '$$$'
    }
}
    
    
    
    const styles = {
        'backgroundImage': seasonTest(props),
        'color': 'teal',
        'height': 150,
        textShadowColor: 'rgba(0, 0, 0, 0.75)',
        textShadowOffset: {width: -1, height: 1},
        textShadowRadius: 10
    }
    console.log(props)
    return(
        <div style = {styles}>
            <h1>{props.place}</h1>
            <h3>{priceCheck(props)}{props.price}</h3>
            <h3>{props.season}</h3>
            

        </div>
    )
}

export default Vacation